webpackJsonp([0xe68d9f3a7cd9],{499:function(e,n){e.exports={data:{markdownRemark:{html:"<blockquote>\n<p>Message 1585 : Fri May  8 (Azriya)     :: The Shadow Rises</p>\n</blockquote>\n<p>The increasing aid of Gondor to Vinyanost and the free peoples of the\nAnduin vale has become a minor nuisance to the Lords of Dol Guldur.  In\nreponse, Dol Guldur has taken an interest in fortifying their domain. They\nhave sent a company of orcs and uruks to reinforce the stronghold of the young\nuruk mage.</p>\n<p>Expect changes in the area.\nCourtesy of Turamarth.\nAs always, feel free to mudmail management with any concerns.</p>",frontmatter:{title:"News 1585: The Shadow Rises",date:"October 09, 2017",author:null,desc:null}}},pathContext:{slug:"/news/1585"}}}});
